  Button,
  {}
)({
  color: "#D50000",
  background: "transparent",
});

export default function AboutPageButton() {
  return (
    <>
      <StyledButton>
        <Button disableRipple={true} style={{background:'none'}} >deneme1</Button>
      </StyledButton>
    </>
  );
}
